import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>My Awesome Website</h1>
      <nav>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Contact</a>
      </nav>
    </header>
  );
}

export default Header;
